import React from "react";

function Note(props) {
  return (
    <div className="note" style={{ backgroundColor: props.note.color }}>
      <textarea className="note_text" defaultValue={props.note.text} />
      <div>
        <p>{props.note.time}</p>
        <img src="{deleteIcon" alt="Delete" />
      </div>
    </div>
  );
}
export default Note;
